// ProductCard.js
import React from 'react';

const ProductCard = ({ productPair }) => {
  return (
    <div className="product-card">
      <img src={productPair.productImage} alt={productPair.productName} />
      <h3>{productPair.productName}</h3>
      <p>Price: ${productPair.price}</p>
      <p>Rating: {productPair.rating}</p>
      <button>Compare Now</button>
    </div>
  );
};

export default ProductCard;
